// Additional utility functions
export const getCompanyStats = () => {
  return Object.keys(companyWiseQuestions).map(key => {
    const company = companyWiseQuestions[key];
    const questions = company.questions;
    
    const difficultyCount = {
      Easy: questions.filter(q => q.difficulty === 'Easy').length,
      Medium: questions.filter(q => q.difficulty === 'Medium').length,
      Hard: questions.filter(q => q.difficulty === 'Hard').length
    };
    
    const frequencyCount = {
      'Very High': questions.filter(q => q.frequency === 'Very High').length,
      'High': questions.filter(q => q.frequency === 'High').length,
      'Medium': questions.filter(q => q.frequency === 'Medium').length,
      'Low': questions.filter(q => q.frequency === 'Low').length
    };
    
    const topicCount = {};
    questions.forEach(q => {
      topicCount[q.topic] = (topicCount[q.topic] || 0) + 1;
    });
    
    return {
      id: key,
      name: company.name,
      totalQuestions: questions.length,
      difficultyCount,
      frequencyCount,
      topicCount,
      mostCommonTopic: Object.keys(topicCount).reduce((a, b) => topicCount[a] > topicCount[b] ? a : b)
    };
  });
};

// Get trending companies (based on question frequency)
export const getTrendingCompanies = () => {
  return companyList
    .map(company => {
      const questions = companyWiseQuestions[company.id].questions;
      const highFreqCount = questions.filter(q => 
        q.frequency === 'Very High' || q.frequency === 'High'
      ).length;
      return {
        ...company,
        trendingScore: (highFreqCount / questions.length) * 100
      };
    })
    .sort((a, b) => b.trendingScore - a.trendingScore)
    .slice(0, 6);
};

// Search functionality
export const searchQuestions = (query, companyId = null) => {
  const results = [];
  const companies = companyId ? [companyId] : Object.keys(companyWiseQuestions);
  
  companies.forEach(id => {
    const company = companyWiseQuestions[id];
    const matchingQuestions = company.questions.filter(q => 
      q.title.toLowerCase().includes(query.toLowerCase()) ||
      q.topic.toLowerCase().includes(query.toLowerCase())
    );
    
    if (matchingQuestions.length > 0) {
      results.push({
        company: company.name,
        companyId: id,
        questions: matchingQuestions
      });
    }
  });
  
  return results;
};